import { HeaderPage } from "../../components/Admin"
import { useTable } from '../../hooks';

export function OrdersAdmin() {
  const { loading, tables, getTables } = useTable();

  useEffect(() => getTables, [])
  
  return (
    <>
      <HeaderPage title="Restaurante" />
    </>
  )
}
